import React from 'react';
import {SocialButton} from "@shared/ui";
import {SOCIAL_ASSETS} from "@shared/config";
import {SocialService} from "../api";

const Vk = (props: any) => {
    const onClick = async () => {
        await SocialService.vk();
    };

    return (
        <SocialButton src={SOCIAL_ASSETS.VK} onClick={onClick} {...props}>
            ВКонтакте
        </SocialButton>
    );
};

export default Vk;
